import { StoreContext } from './store';

function Sample1() {
  return (
    <>
      <StoreContext.Consumer>
        <div>{value => console.log(value)}</div>
      </StoreContext.Consumer>
      <div>Sample 1</div>
    </>
  );
}

export default Sample1;
